import React from 'react';
import logo from '../Media/logo.png'
function Nav(params) {
    return(
        <nav>
            <div>
                <img src={logo} alt="" />
                <ul>
                    <li>Products</li>
                    <li>For Teams</li>
                    <li>Support</li>
                </ul>
            </div>
            <div className='div2'>
            <button>  <i className='fa fa-search'></i></button>
                <button className='login'>LogIn</button>
                <button className='signup'>SignUp</button>


            </div>
        </nav>
    );

};export default Nav;
